import React from 'react';
import images from "./imgs.js";
import Card from "./Card.jsx";
import "./index.css";

function createcard(props)
{
  return(
    <div key={props.id}>
      <Card  val={props.pic}/>
    </div>
  );
}

function App() {
  return (
    <div >
      {images.map(createcard)}
    </div>
  );
}

export default App;
